import axios from "axios";
import { ACCESS_TOKEN_USER } from "../types";

export const getUsers = (data) => async (dispatch) => {
  try {
    const req = await ax.post("/checkusers", data);
    dispatch({
      type: ACCESS_TOKEN_USER,
      payload: { token: req.data },
    });
    return req;
  } catch (error) {
    console.log(error);
  }
};
